import React, { useState } from "react";
import Github from "../../../../Icons/github.png";
import Twitter from "/Icons/twitter.png";
import coding from "/Icons/coding.png";
import Linkedin from "/Icons/linkedin.png";
import Style from "./Links.module.css";

const Links = () => {
  const [activeIcon, setActiveIcon] = useState(false);
  const classes = `${Style["links"]} ${
    Style[activeIcon ? "links_active" : ""]
  } `;
  return (
    <div className={classes}>
      <a href="#" className={Style["links_github"]}>
        <img src={Github} width="37px" height="37px" alt="github" />
      </a>
      <a href="#" className={Style["links_twitter"]}>
        <img src={Twitter} width="37px" height="37px" alt="twitter" />
      </a>
      <button
        onClick={() => setActiveIcon(!activeIcon)}
        className={Style["links_btn"]}
      >
        +
      </button>
      <a href="#" className={Style["links_coding"]}>
        <img src={coding} width="37px" height="37px" alt="coding" />
      </a>
      <a href="#" className={Style["links_linkedin"]}>
        <img src={Linkedin} width="37px" height="37px" alt="linkedin" />
      </a>
    </div>
  );
};

export default Links;
